; copy the destination file path
lea rbx, destination
mov cx, 511
cmp byte ptr[rax], 34
je command_copy_destination_quote
command_copy_destination_loop:
mov dl, [rax]
test dl, dl
jz command_failure
cmp dl, 32
je command_seek_source
mov [rbx], dl
add rax, 1
add rbx, 1
add cx, -1
jnz command_copy_destination_loop
jmp command_failure

command_copy_destination_quote:
add rax, 1
mov dl, [rax]
test dl, dl
jz command_failure
cmp dl, 34
je command_copy_destination_quote_end
mov [rbx], dl
add rbx, 1
add cx, -1
jnz command_copy_destination_quote
jmp command_failure
command_copy_destination_quote_end:
add rax, 1
cmp byte ptr[rax], 32
jne command_failure

command_seek_source:
add rax, 1
cmp byte ptr[rax], 32
je command_seek_source
cmp byte ptr[rax], 0
je command_failure

command_allocate_source:
mov r10, rax
call source_allocate
test rax, rax
jz command_failure

; copy the source path
mov rbx, rax ; copy destination
mov cx, 512 ; path size
cmp byte ptr[r10], 34
je command_copy_source_path_quote
command_copy_source_path:
mov dl, [r10]
test dl, dl
jz command_get_file_handle
cmp dl, 32
je command_get_file_handle
mov [rbx], dl
add r10, 1
add rbx, 1
add cx, -1
jnz command_copy_source_path
jmp command_failure

command_copy_source_path_quote:
add r10, 1
mov dl, [r10]
test dl, dl
jz command_failure
cmp dl, 34
je command_copy_source_path_quote_end
mov [rbx], dl
add rbx, 1
add cx, -1
jnz command_copy_source_path_quote
jmp command_failure
command_copy_source_path_quote_end:
add r10, 1
cmp byte ptr[r10], 0
je command_get_file_handle
cmp byte ptr[r10], 32
jne command_failure

command_get_file_handle:
mov [rsp], r10
mov [rsp+8], rax
add rsp, -56
mov rcx, rax
mov rdx, 2147483648 ; generic read
xor r8d, r8d
xor r9d, r9d
mov qword ptr[rsp+32], 3
mov qword ptr[rsp+40], 128
mov qword ptr[rsp+48], 0
call CreateFileA
add rsp, 56
cmp rax, -1
je command_source_failure

mov [rsp+16], rax ; file handle
mov rcx, rax
mov rdx, rsp
add rdx, 24 ; file size
add rsp, -32
call GetFileSizeEx
add rsp, 32
test rax, rax
jz command_source_failure

mov rax, [rsp+24]
call heap_allocate
test rax, rax
jz command_source_failure
mov [rsp+32], rax

mov rdx, rax
mov rcx, [rsp+16]
mov r8, [rsp+24]
mov r9, rsp
add r9, 40
add rsp, -40
mov qword ptr[rsp+32], 0
call ReadFile
add rsp, 40
test rax, rax
jz command_source_failure

mov rcx, [rsp+16]
call CloseHandle

; store source data
mov rax, [rsp+8]
mov rbx, [rsp+24]
mov rcx, [rsp+32]
mov [rax+512], rcx
mov [rax+520], rbx

mov rax, [rsp]
command_seek_source_repeat:
cmp byte ptr[rax], 32
jne command_seek_source_end
add rax, 1
jmp command_seek_source_repeat
command_seek_source_end:
cmp byte ptr[rax], 0
jne command_allocate_source
jmp emit

command_source_failure:
lea rax, command_source_failure_string
mov bx, 29
call terminal_append_string
call terminal_out
mov ecx, 1
call ExitProcess
